webpackJsonp([76284454815842],{466:function(A,a){A.exports={data:{site:{siteMetadata:{title:"ourbucketl.ist",author:"Dan Rose & Sophie Mellissa"}},markdownRemark:{id:"C:/Users/danja/OneDrive/Documents/GitHub/ourbucketl.ist/src/pages/kuching/index.md absPath of file >>> MarkdownRemark",html:'<h2>Kuching</h2>\n<p>We flew from Kota Kinabalu to Kuching, a city in the state of Sarawak in Malaysian Borneo. We had grand plans for Kuching; visiting Bako National Park, spending some time on Damai beach and going to Seminggoh Orangutan Reserve. But we ended up doing non of those things. We stayed in <a href="https://www.facebook.com/myplacelodgekuching/">My Place Hotel &#x26; Lodge</a> for £11 a night but it turned out to be so damp and smelly we managed just two nights before checking out and upgrading to the <a href="https://batikboutiquehotel.com/">Batik Boutique Hotel</a> which was £34 for the night. The hotel was delightful and it had a huge stone bath (just like the one we’d missed out on in Bali) so we ended up spending the day, from check in at 2PM until 5PM the next day in the room; catching up on sleep, planning our next stop and having as many baths as we could manage in 27 hours.</p>\n<p>Whilst we were in Kuching we visited some of the better known sites, such as the Kuching Mosque which is pink and gold, India Street, the waterfront where we had great views of the Darul Hana Bridge, the government building and Fort Margarita. We also ate in a Fast and Furious Themed cafe called <a href="https://www.facebook.com/feastfuriouscafe/">Feast &#x26; Furious</a>, we both had the Sarawak Laksa which was super spicy! We also found a Chinese restaurant called <a href="http://lifecafe.my/">Life Cafe</a> where the food was super cheap and tasty!</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/kuching-mosque-21995ff4faad450dfb6a1b4b0e28a18b-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Kuching Mosque"\n        title="Kuching Mosque"\n        src="/static/kuching-mosque-21995ff4faad450dfb6a1b4b0e28a18b-769ec.jpg"\n        srcset="/static/kuching-mosque-21995ff4faad450dfb6a1b4b0e28a18b-d9ef2.jpg 225w,\n/static/kuching-mosque-21995ff4faad450dfb6a1b4b0e28a18b-ac97c.jpg 450w,\n/static/kuching-mosque-21995ff4faad450dfb6a1b4b0e28a18b-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Cat City</h2>\n<p>Kuching is known for being the city of cats so of course Dan wouldn’t agree to go to Borneo unless we could visit. Ironically, apart from the statues there weren’t many cats around. We saw 3 different cat statues on roundabouts, one which can be hi-fived in the middle of the busy traffic, but there were more in the city.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/cat-statues-f36697328e9a80704fd293e3e489e951-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Cat Statues"\n        title="Cat Statues"\n        src="/static/cat-statues-f36697328e9a80704fd293e3e489e951-769ec.jpg"\n        srcset="/static/cat-statues-f36697328e9a80704fd293e3e489e951-d9ef2.jpg 225w,\n/static/cat-statues-f36697328e9a80704fd293e3e489e951-ac97c.jpg 450w,\n/static/cat-statues-f36697328e9a80704fd293e3e489e951-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We also visited the <a href="https://sarawaktourism.com/attraction/cat-museum/">Cat museum</a>which was a little far out so we had to catch a Grab. I’m not sure what I was expecting but it was basically a huge hall filled with a crazy cat ladies collection of cat related trinkets and possessions. There were even some badly taxidermied cats right at the end.</p>\n<h2>Sarawak Cultural Museum</h2>\n<p>There were lot of different trips we could have done to visit some of the Borneo tribes in their longhouses in Sarawak. We looked at one to the Iban tribe but read that they put on a cockfight for tourists and we were worried that a trip like this might feel like a human zoo. This wasn’t something that we would have felt comfortable watching so instead we decided to visit <a href="https://scv.com.my/">Sarawak Cultural Museum</a>. It wasn’t authentic but it was an open air museum that displayed replicas of seven different types of traditional houses and longhouses found in Malaysian Borneo that we could walk around, including; a Malay house, a Chinese Farm house, Iban, Bidhyu and an Orang Ulu longhouse.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/malay-house-79d9bf24927e31f83e6276f3154d13a1-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Malay House"\n        title="Malay House"\n        src="/static/malay-house-79d9bf24927e31f83e6276f3154d13a1-769ec.jpg"\n        srcset="/static/malay-house-79d9bf24927e31f83e6276f3154d13a1-d9ef2.jpg 225w,\n/static/malay-house-79d9bf24927e31f83e6276f3154d13a1-ac97c.jpg 450w,\n/static/malay-house-79d9bf24927e31f83e6276f3154d13a1-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>People were dressed up in the tribes traditional clothing and at 11:30 they put on a cultural show. This was much better than we expected it to be, mainly because of the one guy in a loincloth. As part of his act he was using a blow dart and picked a westerner to help him, which everyone thought was hilarious. It made a good visit for half a day and we even saw a picture of Prince Charles and Camila on the wall of the Iban longhouse from when they had visited less than a year before us. A trip good enough for royalty.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/cultural-show-27a972f024cf15fbfa567fdedc035c2a-769ec.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 900px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Cultural Show"\n        title="Cultural Show"\n        src="/static/cultural-show-27a972f024cf15fbfa567fdedc035c2a-769ec.jpg"\n        srcset="/static/cultural-show-27a972f024cf15fbfa567fdedc035c2a-d9ef2.jpg 225w,\n/static/cultural-show-27a972f024cf15fbfa567fdedc035c2a-ac97c.jpg 450w,\n/static/cultural-show-27a972f024cf15fbfa567fdedc035c2a-769ec.jpg 900w"\n        sizes="(max-width: 900px) 100vw, 900px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>Our verdict on Kuching</h2>\n<p>Kuching doesn’t offer anything different to the places we had visited in Sabah so rather than tiring ourselves out doing things that were similar to what we had done in Kota Kinabalu and Sandakan, we used our time in Kuching to relax a little and prefer for our next stop, Japan.</p>',frontmatter:{title:"Kuching, Malaysia",date:"September 17, 2018",image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.7777777777777777,src:"/static/graffiti-9a0466adab1014345ec128354dc3abd6-47774.jpg",srcSet:"/static/graffiti-9a0466adab1014345ec128354dc3abd6-45ad6.jpg 480w,\n/static/graffiti-9a0466adab1014345ec128354dc3abd6-e2fcf.jpg 960w,\n/static/graffiti-9a0466adab1014345ec128354dc3abd6-47774.jpg 1920w",sizes:"(max-width: 1920px) 100vw, 1920px"}}}}}},pathContext:{slug:"/kuching/",previous:{fields:{slug:"/sandakan/"},frontmatter:{title:"Sandakan, Malaysia"}},next:{fields:{slug:"/yudanaka-and-kanazawa/"},frontmatter:{title:"Yudanaka & Kanazawa, Japan"}}}}}});
